import{_ as a,a as r,b as t,c as i,d as o}from"./chunks/rtk_fem_fb_2.Agg-c_sB.js";import{_ as n,c as l,a8 as s,o as c}from"./chunks/framework.BDnHobkS.js";const b=JSON.parse('{"title":"Femtones MINI2 Receiver","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_fem_mini2.md","filePath":"uk/gps_compass/rtk_gps_fem_mini2.md"}'),p={name:"uk/gps_compass/rtk_gps_fem_mini2.md"};function m(h,e,d,f,_,u){return c(),l("div",null,e[0]||(e[0]=[s('<h1 id="femtones-mini2-receiver" tabindex="-1">Femtones MINI2 Receiver <a class="header-anchor" href="#femtones-mini2-receiver" aria-label="Permalink to &quot;Femtones MINI2 Receiver&quot;">​</a></h1><p><a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> is an RTK GPS receiver that delivers high-rate and reliable RTK initialization for centimeter level positioning. Він призначений для застосувань, які вимагають високоточного позиціонування (наприклад, навігація та картографування тощо).</p><p>Приймач підключений до PX4 через послідовний порт (UART) і може бути налаштований через Ethernet за допомогою стандартного веб-браузера.</p><p><img src="'+a+'" alt="MINI II Receiver"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>PX4 drivers for Ethernet, CAN and USB are under development.</p></div><h2 id="необхідні-параметри-прошивки" tabindex="-1">Необхідні параметри прошивки <a class="header-anchor" href="#необхідні-параметри-прошивки" aria-label="Permalink to &quot;Необхідні параметри прошивки&quot;">​</a></h2><p>При купівлі пристрою необхідно вибрати наступні параметри вбудованого програмного забезпечення:</p><ul><li>5Гц, 10Гц, 20Гц</li><li>INS</li><li>ЗАГОЛОВОК</li><li>OBS</li><li>RTK</li><li>BASE</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Contact <a href="http://www.femtomes.com/" target="_blank" rel="noreferrer">Femtones</a> directly for sales quote:</p><ul><li><strong>Email:</strong> <a href="mailto:sales@femtomes.com" target="_blank" rel="noreferrer">sales@femtomes.com</a></li><li><strong>Telephone:</strong> +86-10-53779838</li></ul><h2 id="функціональні-порти" tabindex="-1">Функціональні Порти <a class="header-anchor" href="#функціональні-порти" aria-label="Permalink to &quot;Функціональні Порти&quot;">​</a></h2><p><img src="'+r+'" alt="MINI II 1"></p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>The <a href="http://www.femtomes.com" target="_blank" rel="noreferrer">MINI2 Receiver</a> is connected to a UART on the flight controller (GPS port) for data. Для живлення модуля вам знадобиться окреме джерело живлення 12В. Контакти на 12-контактному роз&#39;ємі позначені, як показано нижче.</p><p><img src="'+t+'" alt="MINIII2"></p><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Для оцінювання заголовку потрібно, щоб дві антени були на одному рівні і були відстані щонайменше 30 см одна від одної. The direction that they are facing does not matter as it can be configured with the <a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a> parameter.</p><p>Configure the serial port on which the <a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> will run using <a href="./../advanced_config/parameter_reference.html#GPS_1_CONFIG">GPS_1_CONFIG</a>, and set the baud rate to 115200 using <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a>.</p><p>Once configured the receiver is used in the same way as any other <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> (i.e. with respect to the Survey-in process).</p><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><p>MINI2 включає наступні компоненти:</p><ul><li><p><a href="http://www.femtomes.com/#/FB672" target="_blank" rel="noreferrer">FB672</a>: Compact, dual antenna, dual frequency GNSS OEM board (delivers centimeter accurate position and precise heading).</p><p><img src="'+i+'" alt="FB672"></p></li><li><p><a href="http://www.femtomes.com/#/FB6A0" target="_blank" rel="noreferrer">FB6A0</a>: Compact, quadruple frequency GNSS OEM board (delivers centimeter-accurate positioning)</p><p><img src="'+o+'" alt="FB6A0"></p></li></ul><p>Докладні інструкції щодо продукту можна отримати на офіційному веб-сайті або зв&#39;язавшись з нами.</p>',24)]))}const k=n(p,[["render",m]]);export{b as __pageData,k as default};
